import React from 'react'
import './Header.css'

/**
 * The Header component is a banner that displays the name of the current screen as well as some toolbar options in the far
 * right corner.
 * @returns {JSX.Element}
 */
const Header = (props) => {
    return (
        <div className='header__container'>
            <h1>{props.title}</h1>
        </div>
    )
}

/**
 * The Header component is a banner that displays the name of the current screen as well as some toolbar options in the far
 * right corner.
 * @returns {JSX.Element}
 */
export default Header
